import React from 'react';

import './App.css';

import Header from './components/Header';
import Footer from './components/Footer';
import RecomendedCard from './components/RecomendedCards';
import MainContent from './components/MainContent';
function App() {
  return (
    <React.Fragment>
      <Header />
      <div className="container-fluid pt-3">
        <div className="row">
          <MainContent />
          <RecomendedCard />
        </div>
      </div>
      <Footer />
    </React.Fragment>
  );
}

export default App;
